import React, { Component } from 'react'

 class testcomp extends Component {

  constructor(props) {
    super(props)
  
    this.state = {
       user: ''
    }
  }
  

  render() {
    return (
      <div>
        <form>
            <div>
                <label>UserName </label>
                <input type='text' value={this.state.user}></input>
            </div>
        </form>
      </div>
    )
  }
}

export default testcomp
